import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomeComponent from "./components/HomeComponent";
import TestPageComponent from "./components/TestPageComponent";
import ResultPage from "./components/ResultPage";
import AdminLogin from "./components/admin/AdminLogin";
import AdminAttempts from "./components/admin/AdminAttempts";
import AdminRoute from "./components/admin/AdminRoute";
import AdminAudit from "./components/admin/AdminAudit";
import AdminAttemptAnswers from "./components/admin/AdminAttemptAnswers";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomeComponent />} />
        <Route path="/test/:attemptId" element={<TestPageComponent />} />
        <Route path="/result/:attemptId" element={<ResultPage />} />
        <Route path="/admin/login" element={<AdminLogin />} />
        <Route
          path="/admin/attempts"
          element={
            <AdminRoute>
              <AdminAttempts />
            </AdminRoute>
          }
        />
        <Route
          path="/admin/attempt/:attemptId"
          element={
            <AdminRoute>
              <AdminAudit />
            </AdminRoute>
          }
        />
        <Route
          path="/admin/attempt/:attemptId/answers"
          element={
            <AdminRoute>
              <AdminAttemptAnswers />
            </AdminRoute>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
